import React from 'react';
import './App.css';
// import router
import {Switch, Route} from 'react-router-dom'
// import components
import Home from './components/Home'

function App() {
  return (
    <Switch>
        <Route exact path='/' component={Home}/>
      </Switch>
  );
}

export default App;
